import React, { useState } from "react";
import axios from "axios";
import Header from "./Header";
import { Box, Button, Container, FormControl, InputLabel, MenuItem, Select, TextField, Typography } from "@mui/material";

function CreateFile() {
  const [tipoRemessa, setTipoRemessa] = useState("I");
  const [saldoDia1, setSaldoDia1] = useState("");
  const [saldoDia2, setSaldoDia2] = useState("");

  // Valores fixos
  const cnpj = "44478623";
  const conta1 = "3097000003";
  const conta2 = "4193000009";

  const handleCreateFile = async (e) => {
    e.preventDefault();
    const token = localStorage.getItem("token");

    const data = {
      cnpj,
      contas: [
        { codigoConta: conta1, saldoDia: saldoDia1 },
        { codigoConta: conta2, saldoDia: saldoDia2 },
      ],
      tipoRemessa,
    };

    try {
      await axios.post("http://localhost:8000/files.php", data, {
        headers: {
          Authorization: `Bearer ${token}`,
          "Content-Type": "application/json",
        },
      });
      alert("Arquivo criado com sucesso!");
      window.location.href = "/files";
    } catch (error) {
      console.error("Erro ao criar arquivo:", error);
      alert("Erro ao criar arquivo. Tente novamente.");
    }
  };

  return (
    <Container maxWidth="sm" style={{ backgroundColor: "#444B52", padding: "30px", borderRadius: "8px", marginTop: "20px" }}>
      <Header />
      <Typography variant="h4" align="center" gutterBottom style={{ color: "#fff" }}>
        Lançamento 4111
      </Typography>
      <form onSubmit={handleCreateFile}>
        <FormControl fullWidth margin="normal" variant="outlined">
          <InputLabel style={{ color: "#fff" }}>Tipo de Remessa</InputLabel>
          <Select
            value={tipoRemessa}
            onChange={(e) => setTipoRemessa(e.target.value)}
            style={{ backgroundColor: "#fff", borderRadius: "5px" }}
          >
            <MenuItem value="I">I (Primeira remessa do documento)</MenuItem>
            <MenuItem value="S">S (Substituir documento enviado e aceito)</MenuItem>
          </Select>
        </FormControl>

        <TextField
          fullWidth
          label="CNPJ"
          value={cnpj}
          disabled
          margin="normal"
          variant="outlined"
          InputProps={{ style: { backgroundColor: "#e0e0e0", borderRadius: "5px" } }}
        />

        <Typography variant="h6" style={{ color: "#fff", marginTop: "15px" }}>
          Contas
        </Typography>

        <Box display="flex" gap={2} marginBottom={2}>
          <TextField
            fullWidth
            label="Código Conta 1"
            value={conta1}
            disabled
            variant="outlined"
            InputProps={{ style: { backgroundColor: "#e0e0e0", borderRadius: "5px" } }}
          />
          <TextField
            fullWidth
            label="Saldo do Dia"
            type="number"
            value={saldoDia1}
            onChange={(e) => setSaldoDia1(e.target.value)}
            variant="outlined"
          />
        </Box>

        <Box display="flex" gap={2} marginBottom={2}>
          <TextField
            fullWidth
            label="Código Conta 2"
            value={conta2}
            disabled
            variant="outlined"
            InputProps={{ style: { backgroundColor: "#e0e0e0", borderRadius: "5px" } }}
          />
          <TextField
            fullWidth
            label="Saldo do Dia"
            type="number"
            value={saldoDia2}
            onChange={(e) => setSaldoDia2(e.target.value)}
            variant="outlined"
          />
        </Box>

        <Button fullWidth variant="contained" color="primary" type="submit" style={{ marginTop: "15px" }}>
          Criar
        </Button>
      </form>
    </Container>
  );
}

export default CreateFile;
